import React from 'react';
import Header from './Header';
import Nav from './Nav';
import Footer from './Footer';
import styles from './Discography.module.css'
import data from '../data/discography.json'

function Discography(props) {
  console.log(data[0])
  return (
    <>
      <Header type='black'></Header>
      <Nav></Nav>
      <div className={styles.dicsography}>
        <div className={styles.dgpTitle}>DISCOGRAPHY</div>
        {data.map(i => 
          <div>
            <img src={require(i.imgUrl)} alt={i.title} />
            <div>{i.title}</div>
            <div>{i.release_date}</div>
          </div>
        )}
      </div>
      <Footer type='black'></Footer>
    </>
  );
}

export default Discography;
